import React from "react";
import axios from "axios";
import "../../styles/myTeam.css";

const BASE_URL =
  "https://my-json-server.typicode.com/lhmisho/jsonserver/themeOnePricingSection";
class Pricing extends React.Component {
  state = {
    data: {},
    pricingData: [],
    image: "img/myTeam-image.png",
  };

  componentDidMount() {
    axios
      .get(`${BASE_URL}`)
      .then((res) => {
        this.setState({
          data: res.data,
          pricingData: res.data.pricingData,
        });
        // console.log(this.state)
      })
      .catch((err) => console.log(err));
  }

  render() {
    return (
      <div>
        {/* start pricing */}
        <section id="pricing" className="pricing-section ptb-90">
          <div className="pricing-section-wrap">
            <div className="container">
              <div className="row">
                <div className="col-md-12">
                  <div className="section-heading text-center">
                    <h3>{this.state.heading}</h3>
                    <p>{this.state.content}</p>
                  </div>
                </div>
              </div>
              <div className="row align-items-center">
                <div className="col-md-4 col-sm-6">
                  {/* feature single start */}
                      <div key={`f_${idx}`} className="single-feature mb-5">
                        <div className="feature-icon">
                          <div className="icon icon-shape bg-color white-text">
                            <i className={item.iconClass}></i>
                          </div>
                        </div>
                        <div className="feature-content">
                          <h5>{item.heading}</h5>
                          <p className="mb-0">{item.content}</p>
                        </div>
                      </div>
                  {/* feature single end */}
                </div>
                <div className="col-md-4 hidden-sm hidden-xs">
                  <div className="feature-image">
                    <img
                      src={this.state.image}
                      className="pos-hcenter img-responsive"
                      alt=""
                    />
                  </div>
                </div>
                <div className="col-md-4 col-sm-6">
                  {/* feature single start */}
                  {this.state.featureDataTwo.map((item, idx) => {
                    return (
                      <div key={`ft_${idx}`} className="single-feature mb-5">
                        <div className="feature-icon">
                          <div className="icon icon-shape bg-color white-text">
                            <i className={item.iconClass}></i>
                          </div>
                        </div>
                        <div className="feature-content">
                          <h5>{item.heading}</h5>
                          <p className="mb-0">{item.content}</p>
                        </div>
                      </div>
                    );
                  })}
                  {/* feature single end */}
                </div>
              </div>
            </div>
          </div>
        </section>
        {/* end pricing */}
      </div>
    );
  }
}

export default Pricing;
